-- Query generated by: templates/unnest_parquet_view.sql.py telemetry_new_profile_parquet_v2 telemetry_raw.telemetry_new_profile_parquet_v2
CREATE OR REPLACE VIEW
  `moz-fx-data-derived-datasets.telemetry.telemetry_new_profile_parquet_v2` AS
SELECT
  submission AS submission_date,
  * REPLACE (
    (SELECT AS STRUCT environment.* REPLACE ((SELECT AS STRUCT environment.partner.* REPLACE (ARRAY(SELECT * FROM UNNEST(environment.partner.partner_names.list)) AS partner_names)) AS partner)) AS environment
  )
FROM
  `moz-fx-data-derived-datasets.telemetry_raw.telemetry_new_profile_parquet_v2`
